SELECT ?manager WHERE {
  # Step 1: Find the successor season of 2006–07 VfL Bochum
  <http://dbpedia.org/resource/2006%E2%80%9307_VfL_Bochum_season> <http://purl.org/dc/terms/next> ?successorSeason .

  # Step 2: Find the native country of the leader of West Germany (Germany)
  <http://dbpedia.org/resource/Germany> <http://dbpedia.org/ontology/nativeOf> ?nativeCountry .

  # Step 3: Identify the person born on 1968-08-26 who is a sports manager and has managed a soccer club season
  ?manager <http://dbpedia.org/property/birthDate> "1968-08-26"^^xsd:date ;
           <http://dbpedia.org/ontology/title> "Sports Manager" ;
           <http://purl.org/dc/terms/subject> ?soccerClubSeason .

  # Step 4: Determine the manager of the team in that soccer club season
  ?soccerClubSeason <http://dbpedia.org/property/manager> ?manager .
}

SELECT ?birthPlace WHERE {
  { <http://dbpedia.org/resource/Paulus_Powell> <http://dbpedia.org/property/birthPlace> ?birthPlace . }
  UNION
  { <http://dbpedia.org/resource/El_Deafo> <http://dbpedia.org/property/author> ?author .
    FILTER(?author = <http://dbpedia.org/resource/Alecia_Brown>) }
  UNION
  { <http://dbpedia.org/resource/Vince_Gilligan> <http://dbpedia.org/property/birthPlace> ?birthPlace . }
  FILTER(?birthPlace rdf:type <http://dbpedia.org/ontology/AdministrativeRegion> && ?birthPlace rdf:type <http://dbpedia.org/ontology/Region>)
}

SELECT ?child WHERE {
  ?grandparent <http://dbpedia.org/ontology/title> "Duke of Brunswick-Lüneburg" ;
               <http://dbpedia.org/property/spouse> ?parent1 .
  ?parent1 <http://dbpedia.org/property/children> ?child1 .
  ?child1 <http://dbpedia.org/property/spouse> ?spouse1 .
  ?grandparent2 <http://dbpedia.org/ontology/title> "Princess Antoinette of Brunswick-Wolfenbüttel" ;
                <http://dbpedia.org/property/spouse> ?parent2 .
  ?parent2 <http://dbpedia.org/property/children> ?child2 .
  ?child2 <http://dbpedia.org/property/spouse> ?spouse2 .
  FILTER(?parent1 = ?grandparent2 && ?spouse1 = ?spouse2)
  ?parent3 <http://dbpedia.org/ontology/title> "Royalty" ;
           <http://dbpedia.org/property/children> ?child .
}

