SELECT ?manager WHERE { 
  ?season <http://dbpedia.org/ontology/successor> <http://dbpedia.org/resource/2006%E2%80%9307_VfL_Bochum_season> .
  ?club <http://dbpedia.org/property/manager> ?manager ;
         <http://dbpedia.org/property/leagueSeason> ?season .
  FILTER(?manager = <http://dbpedia.org/resource/SBV_Vitesse>'s manager in the 2020-21 season)
}

SELECT ?manager WHERE {
  # Find the player who played in the 2007-08 VfL Bochum season
  ?player <http://dbpedia.org/ontology/team> <http://dbpedia.org/resource/VfL_Bochum> ;
           <http://dbpedia.org/property/season> "2007–08" .

  # Find the manager of that player during the 2007-08 season
  ?player <http://dbpedia.org/ontology/manager> ?manager ;
          <http://dbpedia.org/property/season> "2007–08" .

  # Filter to only include players from Germany
  FILTER(?manager <http://dbpedia.org/ontology/country> <http://dbpedia.org/resource/Germany>) .

  # Find the leader of West Germany (Helmut Kohl)
  ?kohl <http://dbpedia.org/property/title> "Chancellor" ;
         <http://dbpedia.org/property/termStart> "1982-05-30" ;
         <http://dbpedia.org/property/termEnd> "1998-11-22" .

  # Find the manager of Helmut Kohl for the 2020-21 SBV Vitesse season
  ?kohl <http://dbpedia.org/ontology/manager> ?manager ;
         <http://dbpedia.org/property/season> "2020–21" .
}

