}

SELECT ?producer WHERE {
  { <http://dbpedia.org/resource/Janet_Gaynor> <http://dbpedia.org/property/profession> "Actress"@en ; <http://dbpedia.org/property/claim_to_fame> ?movie } UNION
  { <http://dbpedia.org/resource/The_Adventures_of_Tom_Sawyer_(1938_film)> <http://dbpedia.org/ontology/starring> ?actor }
  FILTER(?producer = ?movie)
}
UNION
SELECT ?producer WHERE {
  { <http://dbpedia.org/resource/Kent_Allard> <http://dbpedia.org/property/alter_ego> ?fictionalCharacter } UNION
  { ?fictionalCharacter <http://dbpedia.org/ontology/producer> ?producer }
}

SELECT ?soccerPlayer WHERE {
  # Find the actor who starred in a film directed by Manuel Huerga
  ?film <http://dbpedia.org/ontology/director> <http://dbpedia.org/resource/Manuel_Huerga> ;
         <http://dbpedia.org/ontology/starring> ?actor .

  # Find the soccer player and athlete associated with that actor
  ?soccerPlayer <http://dbpedia.org/property/occupation> "Soccer player"@en ;
                 <http://dbpedia.org/property/occupation> "Athlete"@en ;
                 <http://dbpedia.org/property/starring> ?actor .

  # Find the team of a soccer player and manager born on Marcelo Sarmiento's birthday
  ?soccerManager <http://dbpedia.org/property/birthDate> ?sarmientoBirthday ;
                  <http://dbpedia.org/property/occupation> "Soccer manager"@en ;
                  <http://dbpedia.org/property/team> ?team .

  # Ensure the soccer player and manager are born on the same day
  FILTER(?sarmientoBirthday = ?soccerManagerBirthDate)
}
